import React from 'react';
import H_SData from './H&SData';
import Card from './Card';


const Hide_Show=()=>{
    return(
        <>
        
         {H_SData.map((val)=>{
             return(
                 <Card 
                     ue={val.Que}
                     ans={val.Ans}
                 />
             )
         }) } 
        </>
    )
}

export default Hide_Show;
